import React, { useState, useEffect } from 'react';
import email from './image/email.png';
import linkedin from './image/likedin.png';
import github from './image/github.png';
import facebook from './image/Facebook.png';
import instagram from './image/instagram.png';

const mainContentStyle = {
  backgroundColor: '#171717',
  color: '#aaa',
  textAlign: 'center',
  padding: '2rem',
  minHeight: '100vh',
  position: 'relative',
  overflow: 'hidden',
};

const logoContainerStyle = {
  display: 'flex',
  justifyContent: 'space-evenly', // Evenly space logos
  alignItems: 'center', // Center vertically
  height: '60vh', // Adjust the height for vertical centering
  marginTop: '20px', // Optional: Add top margin if you want some spacing
};


const logoStyle = {
  width: '50px',
  height: '50px',
  borderRadius: '50%',
  filter: 'grayscale(100%)',
  cursor: 'pointer',
  transition: 'filter 0.3s',
};

const envelopeContainerStyle = {
  position: 'relative',
  width: '100%',
  height: '60vh',
  marginTop: '40px',
  display: 'flex',
  flexWrap: 'wrap',
  justifyContent: 'space-around',
};

const envelopeStyle = {
  fontSize: '2.5rem',
  cursor: 'pointer',
  position: 'absolute',
  transition: 'transform 0.2s ease',
};

const jokeBoxStyle = {
  position: 'absolute',
  top: '-60px',
  left: '50%',
  transform: 'translateX(-50%)',
  backgroundColor: '#333',
  color: '#fff',
  padding: '10px 15px',
  borderRadius: '10px',
  fontSize: '1rem',
  whiteSpace: 'nowrap',
  opacity: 0,
  pointerEvents: 'none',
  transition: 'opacity 0.3s ease',
  textAlign: 'center',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
};

const Portfolio = () => {
  const jokes = [
    "Why do programmers prefer dark mode? Because light attracts bugs!",
    "Why do Java developers wear glasses? Because they can't C#!",
    "I told my computer I needed a break, and now it won’t stop sending me KitKats.",
    "Why did the developer go broke? Because they used up all their cache!",
    "How do full-stack devs describe themselves? As 'in-divisible' units!",
    "What’s a programmer’s favorite type of music? Algo-rhythm!"
  ];

  // Generate random positions for envelopes
  const generateRandomPositions = () =>
    Array.from({ length: jokes.length }, () => ({
      top: `${Math.random() * 6 + 8}%`,
      left: `${Math.random() * 43 + 60}%`,
    }));

  const [positions, setPositions] = useState(generateRandomPositions);

  useEffect(() => {
    const handleResize = () => setPositions(generateRandomPositions());
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  return (
    <div style={{ position: 'relative' }}>
      <div style={mainContentStyle}>
        <h1>Contact Me</h1>
        
        {/* Social Media Links */}
        <div style={logoContainerStyle}>
          <a href="https://www.linkedin.com/in/mohammed-bakhshi/" target="_blank" rel="noopener noreferrer">
            <img
              src={linkedin}
              alt="LinkedIn"
              style={logoStyle}
              onMouseEnter={(e) => (e.target.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.target.style.filter = 'grayscale(100%)')}
            />
          </a>
          <a href="https://github.com/Mohammed-Bakhshi" target="_blank" rel="noopener noreferrer">
            <img
              src={github}
              alt="GitHub"
              style={logoStyle}
              onMouseEnter={(e) => (e.target.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.target.style.filter = 'grayscale(100%)')}
            />
          </a>
          <a href="https://www.facebook.com/mohammed.bakhshi/" target="_blank" rel="noopener noreferrer">
            <img
              src={facebook}
              alt="Facebook"
              style={logoStyle}
              onMouseEnter={(e) => (e.target.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.target.style.filter = 'grayscale(100%)')}
            />
          </a>
          <a href="https://instagram.com/mohammedbakhshi/" target="_blank" rel="noopener noreferrer">
            <img
              src={instagram}
              alt="Instagram"
              style={logoStyle}
              onMouseEnter={(e) => (e.target.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.target.style.filter = 'grayscale(100%)')}
            />
          </a>
          <a href="mailto:mohammedbakhshi@hotmail.com" target="_blank" rel="noopener noreferrer">
            <img
              src={email}
              alt="Email"
              style={logoStyle}
              onMouseEnter={(e) => (e.target.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.target.style.filter = 'grayscale(100%)')}
            />
          </a>
        </div>

        {/* Jokes Section */}
        <div style={envelopeContainerStyle}>
          {jokes.map((joke, index) => (
            <span
              key={index}
              style={{ ...envelopeStyle, ...positions[index] }}
              onMouseEnter={(e) => {
                const jokeElement = e.target.querySelector('.joke-box');
                jokeElement.style.opacity = 1;
              }}
              onMouseLeave={(e) => {
                const jokeElement = e.target.querySelector('.joke-box');
                jokeElement.style.opacity = 0;
              }}
            >
              📩
              <span className="joke-box" style={jokeBoxStyle}>{joke}</span>
            </span>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
